import react, { useState } from 'react';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Button from 'react-bootstrap/esm/Button';

const PersonalLife = ({moodName, factor, setFactor}) => {

    function handleChange(e){
        setFactor(e.target.value);
        console.log(factor);
    }

    return ( 
        <div className="p-life">
            <h3>Looks like you're feeling {moodName}</h3>
            <p>What focus area is contributing the most to this feeling?</p>
            <div className="options">
                <div class="form-check form-check-inline">
                    <input class="form-check-input" type="radio" name="inlineRadioOptions" id="inlineRadio1" value="sports" onChange={handleChange}/>
                    <label class="form-check-label" for="inlineRadio1">My Sport Skills</label>
                </div>
                <div class="form-check form-check-inline">
                    <input class="form-check-input" type="radio" name="inlineRadioOptions" id="inlineRadio2" value="personal" onChange={handleChange}/>
                    <label class="form-check-label" for="inlineRadio2">My Personal Life</label>
                </div>
                <div class="form-check form-check-inline">
                    <input class="form-check-input" type="radio" name="inlineRadioOptions" id="inlineRadio3" value="academics"  onChange={handleChange}/>
                    <label class="form-check-label" for="inlineRadio3">My Academics</label>
                </div>
            </div>
        </div>
     );
}

export default PersonalLife;
